exports.seed = function(knex, Promise) {
  return knex('inventory').del()
    .then(() => knex('orders').del())
    .then(function () {
      return Promise.all([
        knex('inventory').insert(
          { item_title: 'Two Bears',
            item_description: 'Two Bears. Very Fuzzy. Low maiming',
            item_image: 'data:image/jpeg;base64,',
          item_price: 2.00
        }),
        knex('inventory').insert(
          { item_title: 'Bill Murray',
            item_description: 'Past Prime Movie star. Still very funny',
            item_image: 'data:image/jpeg;base64,',
          item_price: 1.00
        }),
        knex('inventory').insert(
          { item_title: 'Two More Bears',
            item_description: 'Different Bears. Very Fuzzy. Sharp Claws. High maiming',
            item_image: 'data:image/jpeg;base64,',
          item_price: 2.00
        }),
        knex('inventory').insert(
          { item_title: 'Bill Murray',
            item_description: 'Different Movie star. Very funny. Often drunk or seemingly so.',
            item_image: 'data:image/jpeg;base64,',
          item_price: 1.00
        })
      ])
    });
};
